import React from 'react';

import './RentBikeItem.css';

const RentBikeItem = ({items}) => {
    
    const { name, type, price } = items;
    return (
        <div className="rentBikeItem d-flex">
            <p>{`${name} / ${type} / $${price}`}</p>
            <button className="btn btn-outline-success btn-sm float-right">Cancel rent</button>
        </div>
    );
};

export default RentBikeItem;
